/** Kalender-/Motiv-Auswahl **/
/* 
-- Top-Bild durch ausgewähltes austauschen 
-- Parameter, wie Bild-Source und Bild-Name,
-- für weitere Schritte setzen und markieren
*/
$( "a .m.cal_bild" ).click(function( event ) {
  event.preventDefault();
  $(".top_bild").attr('src',$(this).attr('src'));
  $(".motiv").val($(this).attr('motiv'));
  $(".m.motiv").attr('motiv',$(this).attr('motiv'));
  $(".m.motiv").attr('src',$(this).attr('src')); 
  $("label.label_motiv").text($(this).attr('motiv')+' ');
  $(".motive div").removeClass('active');
  $(".motive div").addClass('inactive');

  $(this).parent().parent().toggleClass('inactive active');
  $(".motive div.inactive").show();
});

/** Step-Navigation [weiter / zurück] und Top-Navigation [Variante, Lose, Topping, Rezept] synchronisieren **/
/*
-- je nach step entsprechenden Top-Navigation-Item aktivieren
*/
$('.anker').click(function( event ) {
  step = $(this).attr('step');
  $('.nav-pills li').removeClass('active');
  $('.anker.nav-link').removeClass('active');
  $('.nav-pills li[step="'+step+'"]').addClass('active');
});

/* Definition alle Aktivitäten (click/touch/change) innerhalb einen Sclick-Slide, 
um breakpoint beim Slick zu kontrollieren */
function setButtonsActions() {
  // start_count  => bisher gesetzte Lose
  // test_count   => maximal zulässige Anzahl der Lose (24 beim Adventskalender/ 7 beim Silvesterkalender )

  $('.los_count').change(function(event)
  { // Lose-Anzahl direkt eingeben
    event.preventDefault();
    var end_count     = 0;
    var price         = 0;
    var start_count   = $('#total').val();
    var change_value  = $(this).val();  
    // Anzahl der Lose neu berechnen
    end_count         = $(this).losCount();

    if(end_count <= test_count)
    { // maximal zulässige Anzahl der Lose ist nicht überschritten

      // Kalender-Preis neu berechnen
      price = $(this).allLosPrice(price);  
      // Anzeige aktualisieren
      $(this).statisticUpdate(end_count,price);  
    }
    else
    {    
      // maximal zulässige Anzahl der Lose ist überschritten, zurücksetzen mit der 'Fehlermeldung'
      $('.extra_lose').addClass('disabled'); // Nächster Schritt ist noch nicht möglich
      // vorherigen Wert ermitteln und zurücksetzen
      var dif         = parseInt(end_count) - start_count;
      var back_value  = parseInt(change_value) - dif;    
      alert(change_value + ' ist zu groß. Diese Menge wird zurück auf '+ back_value + ' gesetzt');
      $(this).val(back_value);    
    }
  });

  $('.input-group button.btn-increment').on('click touch', function( event ) 
  {  
    // Los-Auswahl '+ Click'
    event.preventDefault();

    var los         = $(this).parent().parent().find('.los_count');
    var start_count = $('#total').val();
    var price       = 0;
    var end_count   = parseInt(start_count) + 1;

    los.val(parseInt(los.val()) + 1); 

    // beim aktuellen Los '- Click' aktivieren
    $(this).parent().parent().find('.btn-decrement').prop('disabled', false).removeClass('disabled'); 

    if(end_count == test_count)
    {
      // maximal zulässige Anzahl der Lose ist erreicht, Lose-Auswahl ist nicht mehr möglich 
      // '+ Click' bei allen Losen deaktivieren
      $('.input-group button.btn-increment').prop('disabled', true).addClass('disabled');

      // Step 'Topping' aktivieren
      $('.extra_lose').removeClass('disabled'); 
    }

    // Kalender-Preis neu berechnen    
    price           = $(this).allLosPrice(price);
    // Rezept aktualisieren
    end_count=$(this).losCount();
    // Anzeige aktualisieren
    $(this).statisticUpdate(end_count,price);
  });

  $('.input-group button.btn-decrement').on('click touch',function( event ) 
  {
    // Los-Auswahl '- Click'
    event.preventDefault(); 

    var los         = $(this).parent().parent().find('.los_count');
    var start_count = $('#total').val();
    var price       = 0;
    var end_count   = parseInt(start_count)-1;

    los.val(parseInt(los.val()) - 1); 

    // '+ Click' bei allen Losen aktivieren
    $('.input-group button.btn-increment').prop('disabled', false).removeClass('disabled');
      
    if(parseInt(los.val())== 0)
    {
      // beim aktuellen Los '- Click' deaktivieren
      $(this).prop('disabled', true).addClass('disabled');
    }

    // Kalender-Preis neu berechnen 
    price           = $(this).allLosPrice(price);
    // Rezept aktualisieren
    end_count       = $(this).losCount();    
    // Anzeige aktualisieren
    $(this).statisticUpdate(end_count,price);

    // Step 'Topping' deaktivieren
    $('.extra_lose').addClass('disabled');
  });

  $('input[type="checkbox"]').on('change', function() 
  {
    // Auswahl der Lose durch aktivieren einer Checkbox. Simulieren Radiobutton-Funktion

    // Alle Checkbox, ausser geklickten, deaktivieren
    $('input[name="' + this.name + '"]').not(this).prop('checked', false);

    var extra_lose    = 0;
    var current_price = 0;
    var current_los   = '';

    $('input[type="checkbox"]').each(function( index ) {
      if($(this).prop("checked") == true){
          extra_lose++;
          current_price = $(this).attr('los_price');
          current_los   = $(this).val();
      }
    });

    // Default-Topping-Text für Step-Rezept definieren
    $('.extra_los_rezept').html('<b>TOPPING</b><div class="row"><div class="col-12 topping_name">kein optionales Topping-Los ausgewählt</div><div class="topping_preis" hidden></div></div>');

    if(extra_lose>0)
    {
      // Topping-Text für Step-Rezept durch Auswahl aktualisieren
      $('.extra_los_rezept').html('<b>TOPPING</b><div class="row"><div class="col-8 topping_name">1x '+ current_los
        +'</div><div class="col-4 text-right topping_preis">'+parseFloat(current_price).toFixed(2).replace('.', ',') + ' €</div></div>');
    }

      // Kalender-Preis aktualisieren
      $('.cal_price').html((parseFloat($('.all_los_price').val()) + parseFloat(current_price)).toFixed(2).replace('.', ','));

    // Anzahl der Extra-Lose festhalten
    $('.erg').html(extra_lose);
  });
};

function getSlidesToShow() 
{
  // Slides pro 'page' nach Ansichts-Breite
  var width   = $(window).width();
  var slides  = 2;
  if (width < 281) {
    slides    = 1;
  }
  return slides;
}

// Definition der Slider-Einstellungen
var SLICKconfig = {

  dots:             false,
  slidesToScroll:   1,
  touchMove:        true,
  infinite:         false,
  arrows:           true,
  slidesToShow :    getSlidesToShow(),

  // Slide-Buttons: prev und next
  prevArrow:"<button type='button' class='slick-prev pull-left'><i class='fas fa-chevron-left swiper-button-red' aria-hidden='true'></i></button>",
  nextArrow:"<button type='button' class='slick-next pull-right'><i class='fas fa-chevron-right swiper-button-red' aria-hidden='true'></i></button>"
 };

// Default-Settings für Lose
/*
  kein Dekrementieren beim Starten
  Step 'Topping' deaktiviert
*/
$('.slide_text .btn-increment').prop('disabled', false).removeClass('disabled');
$('.slide_text .btn-decrement').prop('disabled', true).addClass('disabled');
$('.extra_lose').addClass('disabled');

// Container als Slider 'definieren'
$('.one-time').slick(SLICKconfig);
setButtonsActions();

$(window).resize(function () 
{
  // Bei Größeanderung die Slider-Einstellungen anpassen
  $('.one-time').slick("unslick");
  SLICKconfig.slidesToShow = getSlidesToShow();
  $('.one-time').slick(SLICKconfig);
  setButtonsActions();
});

$.fn.losCount = function()
{ 
  // 'Rezept-Zutaten' neu zusammenstellen und aktuelle Lose-Anzahl zurückliefern
  var end_count = 0;
  // Rezept löschen
  $('.backrezept').html('');
  
  $('.los_count').each(function( index ) {

    los_count = parseInt($(this).val());    
    end_count += los_count;
    
    $(this).parent().find('.btn-decrement').prop('disabled', true).addClass('disabled');
    
    if(los_count>0)
    {       
      // Los ist ausgewählt
      los_price = $(this).parent().parent().find('label.los_price').html();
      los_name  = $(this).parent().parent().find('label.los_name').html();

      // '- Click' aktivieren
      $(this).parent().find('.btn-decrement').prop('disabled', false).removeClass('disabled');

      // In das Rezept eintragen
      $('.backrezept').html($('.backrezept').html()
        +'<div class="row">' 
        + '<div class="col-7">'+ los_count + 'x ' + los_name +'</div>' 
        + '<div class="col-5 text-right">' + (los_count*los_price).toFixed(2).replace('.', ',') + ' €</div>' 
        + '</div>');      
    }
  });  

  if(end_count<test_count)
  {
    // maximal zulässige Anzahl der Lose ist nicht erreicht 
    // '+ Click' aktivieren  ; Step 'Topping' bleibt deaktiviert  
    $('.input-group button.btn-increment').prop('disabled', false).removeClass('disabled');
    $('.extra_lose').addClass('disabled');
  }
  if(end_count==test_count)
  {
    // maximal zulässige Anzahl der Lose ist erreicht 
    // '+ Click' deaktivieren  ; Step 'Topping' aktivieren      
    $('.input-group button.btn-increment').prop('disabled', true).addClass('disabled');
    $('.extra_lose').removeClass('disabled');       
  }
  return end_count;
}

$.fn.allLosPrice = function(price)
{ 
  // Aktuelle Lose-Preis-Summe zurückliefern  
  $('.los_count').each(function( index ) {
    los_count = parseInt($(this).val());  
    los_price = $(this).parent().parent().find('label.los_price').html();

    price += los_count*los_price;
  });  
  return price;
}

$.fn.statisticUpdate = function(g_count,price)
{ 
  // Pro Los-Auswahl (click, touch, change, checkbox) Statistik-Anzeige aktualisieren
  $('#total').val(g_count);
  $('.total').html(g_count);
  $('.all_los_price').val(price);
  $('.cal_price').html(price.toFixed(2).replace('.', ','));
}

