  // klick 'zufällige Auswahl'
  $( ".zufall a" ).click(function( event ) { 
    event.preventDefault();

    var g_count     = 0;      
    var price       = 0;  
    var t_count     = 0;    
    var random      = 0;  
    var max_count   = test_count; 

    // alle für Kalender definierte Lose erfassen  
    var lose        = $('.los_count:text');
    var typ         = lose.length;        


    $('.backrezept').html('<b>LOSE</b><br>');
    $(this).addClass('disabled');

    // Auswahl zurücksetzen
    lose.each(function( index ) {
      $(this).val(0);
      $(this).parent().find('.btn-decrement').prop('disabled', true).addClass('disabled');
      $(this).parent().find('.btn-increment').prop('disabled', true).addClass('disabled');
    })

    while (g_count < test_count && t_count<lose.length) {
      // Los zufällig auswählen
      l_index = Math.floor((Math.random() * typ)); 
      random  = 0;

      // wurde vorher noch nicht ausgewählt
      if(lose.eq( l_index ).val()==0)
      {   
        los_price = lose.eq( l_index ).parent().parent().find('label.los_price').html();
        los_name  = lose.eq( l_index ).parent().parent().find('label.los_name').html();
        random    = max_count;
        t_count++;
        // wenn noch nicht alle Lose gesetzt und maximale Anzahl noch nicht erreicht ist
        if(t_count<lose.length)
        {
          random = Math.floor((Math.random() * max_count) + 1);
        }
        
        lose.eq( l_index ).val(random);        
        // '- Click' aktivieren
        lose.eq( l_index ).parent().find('.btn-decrement').prop('disabled', false).removeClass('disabled');

        price += parseInt(random*los_price);
        // In das Rezept eintragen
        $('.backrezept').html($('.backrezept').html() 
          + '<div class="row">' 
            + '<div class="col-7">' 
              + random + 'x ' + los_name
            + '</div>' 
            + '<div class="col-5 text-right">' 
              + (random*los_price).toFixed(2).replace('.', ',') + ' €' 
            + '</div>' 
          + '</div>'); 
        // Lose-Anzahl aktualisieren         
        g_count   += random;
        max_count -= random;
      }
    } 

    // Anzeige aktualisieren
    $(this).statisticUpdate(g_count,price);

    // Step 'Topping' aktivieren
    $('.extra_lose').removeClass('disabled');
  });
